import React from 'react';
import Card from './UI/Card';
import './UserList.css';

const UserList = (props) => {
  return (
    <Card className='users'>
      <ul>
        <li>
          {props.map((user) => {
            `${user.name} (${user.age}세)`;
          })}
        </li>
      </ul>
    </Card>
  );
};

export default UserList;
